import React, { useState } from 'react'

const TestComponent =()=> {

    const [number, setNumber] = useState(0)

    const handleClick =()=> {
        let newNumber = number++
        setNumber(newNumber)
    }
    
    return (
        <div>   
            <h1 onClick={handleClick}>count: {number}</h1>
        </div>
    )
}

export default TestComponent
